import React from 'react'
import { Routes, Route } from "react-router-dom"
import logo from "../../images/logo.png"
import { LoginPage } from '../Pages/LoginPage'
import { NavBar } from './NavBar'
import { HomePage } from '../Pages/HomePage'
import { ProfilePage } from '../Pages/ProfilePage'
import { LibraryPage } from '../Pages/LibraryPage'
import { StorePage } from '../Store/StorePage'

export const MainPagesContainer = (props) => {
    const deleteToken = () => {
      sessionStorage.removeItem("userToken");
    }

    const pages = [{
      name: "Home",
      relativePath: "/home",
      element: <HomePage />
    },{
      name: "Store",
      relativePath: "/store",
      element: <StorePage />
    },{
      name: "Library",
      relativePath: "/library",
      element: <LibraryPage />
    },{
      name: "Profile",
      relativePath: "/profile",
      element: <ProfilePage />
    },{
      name: "Logout",
      relativePath: "/",
      element: <LoginPage />,
      extra_fn: deleteToken
    }]

    const routes = pages.map((page, index) => <Route path={page.relativePath} element={page.element} extra_fn={page.extra_fn} key={index} />);

    return(
      <>
        <img src={logo} alt="logo" id="site_logo"></img>
        <NavBar pages={pages} />
        <Routes>
          {routes}
        </Routes>
      </>
    )
  }
